import React from "react";
import DropDown from "./DropDown";

const AssignTab = () => {
  const tabStyle = {
    height: "100%",
    width: "100%",
    display: "flex",
    flexDirection: "column",
    justifyContent: "space-evenly",
    padding: "10vh",
  };

  return (
    <div style={tabStyle}>
      <DropDown
        label="assignTo"
        options={["Aaron", "Harmeet", "Megh", "Poojitha", "Nikola", "Tia"]}
        defaultVal="Name"
      />
      <DropDown
        title="exercises"
        options={["hamstring", "quadriceps", "calf", "ankle"]}
      />
      <button class="ui button" style={{ alignSelf: "flex-end" }}>
        Follow
      </button>
    </div>
  );
};

export default AssignTab;
